                <tr>
                    <td>Countries</td>
                    <td>Emoji</td>
                    <td>Capital</td>
                    <td>Currency</td>
                </tr>
                </thead>
                <tbody>
                {records.map((data) => {
                    return (
                    <tr>
                        <td>{data.name}</td>
                        <td>{data.emoji}</td>
                        <td>{data.capital}</td>
                        <td>{data.currency}</td>
                    </tr>
